import React from 'react'
import {
    View,
    Text,
    StyleSheet,
    Image,
    TouchableOpacity
} from 'react-native'

const ProductItem = () => {
    return (
        <TouchableOpacity style={styles.containe} activeOpacity={0.5}>
            <View style={styles.Image_pro}>
                <Text>Ashutosh</Text>

                <View style={{ justifyContent: "flex-end", marginLeft: 1 }}>
                    <Text>$234</Text>
                </View>
            </View>
            <Image
                resizeMode="cover"
                style={{
                    position : "absolute",
                    paddingTop: 5,
                    right: 0,
                    width: "98%"
                }}
                source={{
                    uri: 'https://res.cloudinary.com/http-codingcampus-pythonanywhere-com/image/upload/v1615399961/test/lwmgl7wiob0ptb8wrfq5.png'
                }}
            />
        </TouchableOpacity>
    )
}

export default ProductItem

const styles = StyleSheet.create({
    containe: {
        height: 250,
        width: 150,
        marginHorizontal: 4,
        marginTop: 5,
    },

    Image_pro: {
        flex: 1,
        width: 150,
        justifyContent: "flex-start",
        borderRadius: 10,
        backgroundColor: "lightblue",
    }
})
